import React, { Component } from 'react';
import './beranda.css';
import Banner from './img/banner.png';

class Beranda extends Component {
    render() {
        return (
            <div className="container">
                {/* Banner Image */}
                <a href=''></a>
                
                {/* Trending Background */}
                <div className="trending-bg">
                    <div className='1'>1</div>
                </div>

            </div>
        );
    }
}

export default Beranda;
